import { Component } from "@angular/core";

@Component({
  selector: "app-breeds-list",
  templateUrl: "./breeds-list.component.html",
  styleUrls: ["./breeds-list.component.scss"],
})
export class BreedsListComponent {
  public breeds = [
    {
      breed: "Affenpinscher",
      country: "Germany",
      origin: "Mid-19th century",
      coat: "Short",
      pattern: "Solid",
    },
    {
      breed: "Afghan Hound",
      country: "Afghanistan",
      origin: "13th century",
      coat: "Long",
      pattern: "Solid",
    },
  ];
}
